import React from "react";

export default class Park extends React.Component {
    render() {
        return (
            <header className = "Park">
                <h1>{ this.props.fullName }</h1>
                <div>{ this.props.description }</div>
                <div>{ this.props.activities }</div>
            </header>

        )
    }
}
